def gerar_codigo_java(acoes):
    cabecalho = [
        "package com.techelevator;",
        "import org.junit.Test;",
        "",
        "public class TesteMaquinaVendasEdgeCoverage {",
        "  /* Chama a hierarquia do menu_principal */",
        "  VendingMachineMenuPrincipalImplementacao menu_principal = new VendingMachineMenuPrincipalImplementacao();",
        "  /* Chama a hierarquia do menu_compra */",
        "  VendingMachineCompraImplementacao menu_compra = new VendingMachineCompraImplementacao();",
        ""
    ]
    
    codigo = []
    teste_num = 7
    contexto = "menu_principal"
    i = 0
    acao_anterior = ""
    
    codigo.append(f"  @Test\n  public void Teste{teste_num}() {{")
    
    while i < len(acoes):
        acao = acoes[i]
        
        if acao == "e_finalizar_programa" and i + 1 < len(acoes) and acoes[i + 1] == "fim":
            codigo.append(f"    {contexto}.e_finalizar_programa();")
            codigo.append(f"    {contexto}.fim();")
            codigo.append("  }\n")
            teste_num += 1
            
            # se houver um "e_restart", inclui uma única vez e pula ele
            if i < len(acoes) and acoes[i] == "e_restart":
                codigo.append(f"  @Test\n  public void Teste{teste_num}() {{")
                codigo.append("    menu_principal.e_restart();")
                i += 1
            else:
                codigo.append(f"  @Test\n  public void Teste{teste_num}() {{")
            contexto = "menu_principal"
            continue
        
        if acao == "menu_principal":
            contexto = "menu_principal"
            codigo.append("    menu_principal.menu_principal();")
        elif acao == "menu_compra":
            if acao_anterior == "menu_principal.e_escolhe_opcao2":
                codigo.append("    menu_principal.menu_compra_inicio();")
            else:
                contexto = "menu_compra"
                codigo.append("    menu_compra.menu_compra();")
        elif acao == "menu_compra.menu_principal":
            codigo.append("    menu_principal.menu_principal();")
            contexto = "menu_principal"
        else:
            codigo.append(f"    {contexto}.{acao}();")
        
        acao_anterior = f"{contexto}.{acao}" if not acao.startswith("menu_") else acao
        i += 1

    codigo.append("  }\n}")
    return "\n".join(cabecalho + codigo)

print (gerar_codigo_java(acoes))